import '@individual/BgmModal.scss';

interface BgmModalProps {
  open: boolean;
  onCancel(): void;
}

function BgmModal({open, onCancel}: BgmModalProps) {
  return (
    <>
      {open ? (
        <div className="bgm-background" onClick={onCancel}>
          <div className="container bgm-container"></div>
        </div>
      ) : null}
    </>
  );
}

export default BgmModal;
